        <div class="area_seguridad_left">
            <div class="subtitle h1_azul mb-16">AREA DE SEGURIDAD Y ACOTACIONES</div>
            <div class="txt"> El área de seguridad es el espacio que debe existir alrededor del logotipo sin que ningún otro
                elemento lo rebase ó interfiera, garantizando así una correcta visualización del mismo.

                Establecemos que “x” es un módulo que tendrá como medida el diámetro de la circunferencia con la que se
                construye el logo y, por tanto, el área de seguridad será una unidad de “x” por cada extremo del logo,
                siendo el extremo en algunos casos la tipografía y en otros el isologo en sí.

                Este método se repetirá en las submarcas y servicios, tomando en cuenta la misma medida de “x”, ya que todos
                los logotipos se han conformado con circunferencias del mismo diámetro.

                En el caso de la versión horizontal del logo, que se utiliza únicamente en la marca principal, se usará una
                unidad de “x” como área de seguridad superior e inferior, y “2x” en laterales izquierdo y derecho debido al
                menor tamaño del isologo en esta propuesta. </div>
